      function calculateMA(dayCount, data) {
        var result = [];
        for (var i = 0, len = data.length; i < len; i++) {
          if (i < dayCount) {
            result.push('-');
            continue;
          }
          var sum = 0;
          for (var j = 0; j < dayCount; j++) {
            sum += Number(data[i - j][1]);
          }
          result.push((sum / dayCount).toFixed(2));
        }
        return result;
      }

      function getColor (a, b, flag) {
        if (a > b) {
          return red
        } else {
          return flag ? '#06B800' : green
        }
      }
      function volumesMaker(data) {
        var ret = []
        for(var i = 0; i < data.length; i++) {
          var vColor = getColor(data[i][1],data[i][0])
          ret.push({
            value: data[i][4],
            itemStyle: {
                normal: {
                  color: vColor,
                },
                emphasis: {
                  opacity: 0.5
                }
            },
          })
        }
        return ret
      }
      function getVolumes(val) {
        var volumes = val
        if (volumes < 10000) {
          volumes = Math.round(volumes)+' 股'
        } else if (volumes < 10000 * 10000) {
          volumes = (volumes/10000).toFixed(2)+'万 股'
        } else {
          volumes = (volumes/(10000 * 10000)).toFixed(2)+'亿 股'
        }
        return volumes
      }
      function candleOptionsMaker (data) {

          var time = item[0]
          item.shift()
